Yes, here's a JavaScript function that switches the order of adjectives in a sentence:

```javascript
function switchAdjectives(sentence) {
  // Split the sentence into an array of words
  const words = sentence.split(" ");

  // Find the index of the last space (which is after the second-last word)
  const lastSpaceIndex = words.lastIndexOf(" ");

  // Swap the positions of the first and second-last words
  [words[0], words[lastSpaceIndex - 1]] = [words[lastSpaceIndex - 1], words[0]];

  // Join the words back into a string
  return words.join(" ");
}

// Test the function
const originalSentence = "Beautiful green trees are in the park.";
const switchedSentence = switchAdjectives(originalSentence);
console.log(switchedSentence); // Output: "Green beautiful trees are in the park."
```

In this implementation, we split the input sentence into an array of words using `split()`. We then find the index of the last space character, which will be the position of the second-last word in the array. We swap the positions of the first and second-last words using destructuring assignment, and then join the modified array back into a single string using `join()`. The resulting string will have the adjectives swapped around.

