% Load input image
input_image = imread('image.jpg');

% Convert to grayscale and apply Gaussian filter
gaussian_kernel = fspecial('gaussian', [5 5], 0.5);
gray_image = rgb2gray(input_image);
gaussian_filtered = filter2(gaussian_kernel, gray_image, 'replicate');

% Define Sobel operators in x and y directions
sobel_x = [-1 0 1; -2 0 2; -1 0 1];
sobel_y = [-1 -2 -1; 0 0 0; 1 2 1];

% Apply Sobel operator to Gaussian-filtered image
edge_image_x = conv2(double(gaussian_filtered), sobel_x, 'same');
edge_image_y = conv2(double(gaussian_filtered), sobel_y, 'same');

% Combine edges in both directions and display result
edge_image = sqrt(edge_image_x.^2 + edge_image_y.^2);
imshow(edge_image);
```

