Here's a JavaScript function that takes a string variable in dot notation and returns all entries in an object where the nested key-value pair matches the provided string key:

```js
function findEntriesByKey(obj, key) {
  let result = [];

  function traverseObject(obj, prefix) {
    for (let k in obj) {
      const val = obj[k];
      const keyPath = prefix ? `${prefix}.${k}` : k;

      if (typeof val === 'object') {
        traverseObject(val, keyPath);
      } else if (keyPath.includes(`${key}`)) {
        result.push({ [keyPath]: val });
      }
    }
  }

  traverseObject(obj, '');

  return result;
}
```

To use this function, simply pass in your object and the key you want to search for. The function will recursively traverse through the object and build up a list of all entries whose key path includes the specified key. The resulting list is returned as an array with each entry being an object containing the matching key-value pairs. Here's an example usage:

```js
const myObj = {
  name: { first: "John", last: "Doe" },
  age: 25,
  address: { street: "123 Main St.", city: "Anytown" }
};

const results = findEntriesByKey(myObj, "address");
console.log(results); // Output: [{ "address.street": "123 Main St.", "address.city": "Anytown" }]
```

This function can be useful when dealing with deeply nested objects, as it provides a simple way to extract specific values without having to manually traverse the entire structure.

