```matlab
% Define parameters for simulation
populationSize = 100; % Number of individuals in the population
generations = 1000; % Number of generations to simulate
mutationRate = 0.01; % Probability of mutating a gene
selectionPressure = 1.2; % Factor by which more fit individuals are selected
fitnessFunction = @(x) 0.8 + 0.2 * sin(2 * pi * x); % Function that determines fitness based on a trait

% Initialize population with random traits
traitValues = randn(populationSize, 1);
fitnessScores = fitnessFunction(traitValues);

% Loop through generations
for generation = 1:generations
    % Calculate total fitness score for the population
    totalFitnessScore = sum(fitnessScores);

    % Select individuals based on selection pressure
    selectionProbabilities = fitnessScores / totalFitnessScore;
    selectedIndices = ceil(cumsum(selectionProbabilities) * populationSize);
    newPopulation = traitValues(selectedIndices);

    % Introduce mutations into the new population
    newPopulation(randi(populationSize, 1, populationSize) - 1) = traitValues(randi(populationSize)) + 2 * mutationRate * randn();

    % Update trait values and fitness scores for the next generation
    traitValues = newPopulation;
    fitnessScores = fitnessFunction(traitValues);
end

% Output final population and average fitness score
finalPopulation = traitValues;
