```cpp
int binarySearch(int arr[], int left, int right, int x) {
    while (left <= right) {
        int mid = left + (right - left) / 2;

        // Check if x is present at mid
        if (arr[mid] == x) {
            return mid;
        }

        // If x greater, ignore left half
        if (arr[mid] < x) {
            left = mid + 1;
        }

        // If x is smaller, ignore right half
        else {
            right = mid - 1;
        }
    }

    // if we reach here, then element was not present
    return -1;
}
```

This function takes four parameters: `arr` (the sorted array), `left` (the starting index), `right` (the ending index), and `x` (the value to be searched). It returns the index of `x` in the given array, or -1 if it is not found.

The function uses a while loop to iteratively narrow down the search space until the target value is found or the array boundaries are crossed. At each iteration, the middle element is selected using the formula `mid = (left + right) / 2`, and depending on whether `x` is greater than, less than, or equal to this middle element, the search is continued in the left or right half accordingly.

One important aspect of binary search is that the input array must be sorted in non-decreasing order. This allows us to use the midpoint calculation to ensure that we always divide the search interval into halves of roughly equal size. Additionally, note that if the search range becomes empty (i.e., `left > right`), we know that the target value cannot be present in the array.

